function parseModelId(id) {
  const OPENROUTER_PREFIX = 'openrouter:';
  const TOGETHERAI_PREFIX = 'togetherai:';

  const result = {
    id,
    isOpenRouter: false,
    isTogetherAI: false,
    company: 'other',
    name: id
  };

  // Check platform prefix
  if (id.startsWith(OPENROUTER_PREFIX)) {
    result.isOpenRouter = true;
    const withoutPrefix = id.substring(OPENROUTER_PREFIX.length);
    const parts = withoutPrefix.split('/');
    result.company = parts[0];
    result.name = parts.slice(1).join('/');
  } else if (id.startsWith(TOGETHERAI_PREFIX)) {
    result.isTogetherAI = true;
    const withoutPrefix = id.substring(TOGETHERAI_PREFIX.length);
    const parts = withoutPrefix.split('/');
    result.company = parts[0];
    result.name = parts.slice(1).join('/');
  } else {
    // Direct models - use model_registry lookup or pattern matching
    // Check model_registry for exact match first
    // Fall back to company_patterns regex matching
  }

  return result;
}
